    useEffect(() => {
        axios.post('http://localhost:5000/getPost',{}).
        then(res => {
            console.log(res)
            var [post,SetPost] = useState(res.data)
            return(
                <div>
                    {res.data}
                </div>
            )
        }).
        catch(e=>console.log(e.response))
    })
    return (

        <div></div>

    )
}

export default Showpost
